INSERT INTO `pre_empa_audit_pregunta` (`id_pregunta`, `gl_pregunta`, `gl_respuesta1`, `nr_respuesta1_puntos`, `gl_respuesta2`, `nr_respuesta2_puntos`, `gl_respuesta3`, `nr_respuesta3_puntos`, `gl_respuesta4`, `nr_respuesta4_puntos`, `gl_respuesta5`, `nr_respuesta5_puntos`, `id_usuario_crea`, `fc_crea`) VALUES
(1, '1. ¿Con qué frecuencia consume alguna bebida alcohólica?', 'Nunca.', 0, 'Una o menos veces al mes', 1, 'De 2 a 4 veces al mes', 2, 'De 2 a 3 más veces a la semana', 3, '4 o más veces a la semana', 4, NULL, NULL),
(2, '2. ¿Cuántas unidades estándar de bebidas alcohólicas suele realizar en un día de consumo normal?', '1 o 2', 0, '3 o 4', 1, '5 o 6', 2, '7 a 9', 3, '10 o más', 4, NULL, NULL),
(3, '3. ¿Con qué frecuencia toma 6 o más bebidas alcohólicas en un solo día?', 'Nunca', 0, 'Menos de una vez al mes', 1, 'Mensualmente', 2, 'Semanalmente', 3, 'A diario o casi a diario', 4, NULL, NULL),
(4, '4. ¿Con qué frecuencia en el curso del último año ha sido incapaz de parar de beber una vez había empezado?', 'Nunca', 0, 'Menos de una vez al mes', 1, 'Mensualmente', 2, 'Semanalmente', 3, 'A diario o casi a diario', 4, NULL, NULL),
(5, '5. ¿Con qué frecuencia en el curso del último año no pudo hacer lo que se esperaba de usted porque había bebido?', 'Nunca', 0, 'Menos de una vez al mes', 1, 'Mensualmente', 2, 'Semanalmente', 3, 'A diario o casi a diario', 4, NULL, NULL),
(6, '6. ¿Con qué frecuencia en el curso del último año ha necesitado beber en ayunas para recuperarse después de haber bebido mucho el día anterior?', 'Nunca', 0, 'Menos de una vez al mes', 1, 'Mensualmente', 2, 'Semanalmente', 3, 'A diario o casi a diario', 4, NULL, NULL),
(7, '7. ¿Con qué frecuencia en el curso del último ha tenido remordimientos o sentimientos de culpa después de haber bebido?', 'Nunca', 0, 'Menos de una vez al mes', 1, 'Mensualmente', 2, 'Semanalmente', 3, 'A diario o casi a diario', 4, NULL, NULL),
(8, '8. ¿ Con qué frecuencia en el curso del último año no ha podido recordar lo que sucedió la noche anterior porque había estado bebiendo?', 'Nunca', 0, 'Menos de una vez al mes', 1, 'Mensualmente', 2, 'Semanalmente', 3, 'A diario o casi a diario', 4, NULL, NULL),
(9, '9. ¿Usted o alguna otra persona ha resultado herido porque usted había bebido?', 'No', 0, '', 1, 'Sí, pero no en el curso del último año', 2, '', 3, 'Sí, el último año', 4, NULL, NULL),
(10, '10. ¿Algún familiar, amigo, médico o profesional sanitario ha mostrado preocupación por un consumo de bebidas alcohólicas o le ha sugerido que deje de beber?', 'No', 0, '', 1, 'Sí, pero no en el curso del último año', 2, '', 3, 'Sí, el último año', 4, NULL, NULL);
